import React from 'react'

const ImgCard = (props) => {
  
    return (
        <>
        <img className="card-img"src={props.url} alt={props.namre} />
    
        <p>{props.name}</p>
        <p>Rank:{props.rank}  </p>
        <p>price {props.price}</p>
        <p>marketCap{props.marketCap}</p>
        </>
      )
    
  
}

export default ImgCard
